import {
  IonContent,
  IonHeader,
  IonTitle,
  IonToolbar,
  IonPage,

} from '@ionic/react';
import React from 'react';
import {useParams} from 'react-router';

interface RouteParamas {
  id: string;
}

const EntryPage: React.FC = () => {
  const {id} = useParams<RouteParamas>();
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Entry {id}</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
      Placetext entry
      </IonContent>
      </IonPage>
  );
};

export default EntryPage;
